syntax = "proto3";
package snapchat.grid;
option optimize_for = CODE_SIZE;
option objc_class_prefix = "SDM";
option csharp_namespace = "SnapProto.Snapchat.Grid";

message SDMPaths {
    repeated uint32 deltaLengthsArray = 1;
    repeated sint32 xValuesArray = 2;
    repeated sint32 yValuesArray = 3;
}